import React from "react";
import styles from "./css/App.module.scss";
import FamilyTree from 'react-native-family-tree';
import StoreProvider from "./store";

function App() {
  return (
    <StoreProvider>
      <div className={styles.app}>
        <header className={styles.appHeader}>
          <p>
            Edit <code>src/App.js</code> this is our family website.
          </p>
<FamilyTree title="Rethinam and Family" pathColor='black' siblingGap={10} nodeStyle={{ width: 100, height: 100, justifyContent: "center", alignItems: "center", }} nodeTitleColor='red' familyGap={5} strokeWidth={2} titleColor='green' />
          <a
            className={styles.appLink}
            href="https://reactjs.org"
            target="_blank"
            rel="noopener noreferrer"
          >
            Learn React
          </a>
        </header>
      </div>
    </StoreProvider>
  );
}


export default App;
